}
 class Garage extends React.Component{
    render(){
        return(
            <div>
                <h1>who lives in gar</h1>
                <Car />
            </div>
        )
    }


}
 class Car extends Garage{
    constructor(props) {
        super(props);
        this.state={brand:"ford"}
    }

    changeBrand = () =>{
        this.state({brand: "tot"})
    }
        render(){
        return(<div>
                <h1> i am {this.state.brand} car</h1>
                {this.changeBrand()}
                <h1> i am {this.state.brand} car</h1>
            </div>

        )
    }
}
export default function Test() {
    return(
        <div>
